import React from "react";
import { Card } from "react-bootstrap";
const Iterms = (props) => {
  return (
    <div>
      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" />
        <Card.Body>
          <Card.Title>
            {" "}
            <h2>{props.details.name}</h2>
          </Card.Title>
          <Card.Text>
            <h2>{props.details.price}</h2>
          </Card.Text>
        </Card.Body>
      </Card>

      <h2>{props.details.price}</h2>
    </div>
  );
};

export default Iterms;
